Vue.mixin({
  data() {
    return {
      userId:'',
      employeeId:'',
      supervisor_access:{department:null, main_production_process:[],production_process:[],date:null, yard:null},
      purchase_types:[{name:''}],
      warehouses:[],
      generators:[],
      lock_btn:false,
    };
  },
  mounted() {
    if(this.$route.path=='/login'){
    }else{
      this.checkLogin()
    }
  },
  watch: {
    '$route': 'userAccess'
  },
  methods: {
    checkLogin(){
      var is_loggin = false
      if(localStorage.getItem("userInfo"))
      {
        if(localStorage.getItem("userInfo").length>0){
          var userdtls = JSON.parse(localStorage["userInfo"]);
          this.$root.token = userdtls.access
          this.userId = userdtls.user_details.id
          this.employeeId = userdtls.user_details.employee
          this.$root.userInfo = userdtls.user_details
          if(userdtls.user_details.is_superuser){
            this.$root.user_type = 'super_admin'
          }else if(userdtls.user_details.is_admin){
            this.$root.user_type = 'admin'
          }else if(userdtls.user_details.is_aeo){
            this.$root.user_type = 'aeo'
          }else if(userdtls.user_details.is_qc){
            this.$root.user_type = 'qc'
          }else if(userdtls.user_details.is_security){
            this.$root.user_type = 'security'
          }else if(userdtls.user_details.is_supervisor){
            this.$root.user_type = 'supervisor'
          }
          is_loggin = true
        }
      }
      if(!is_loggin){
          localStorage.removeItem("userInfo");
          this.$root.token = ''
          this.userId = ''
          this.$root.userInfo = []
          this.$router.push('/login')
      }
    },
    signOut(){
        localStorage.removeItem("userInfo");
        this.$root.token = ''
        this.userId = ''
        this.$root.userInfo = []
        this.$router.push('/login')
    },
    userAccess(){
      if(current_base_path!=this.$route.path){
        var not_show_page = false
        current_base_path=this.$route.path
        if(this.$root.user_type!='super_admin' && this.$root.user_type!='admin'){
          if(this.$route.path=='/app/task/tasks' || this.$route.path.includes('/app/task/order-status') || this.$route.path=='/app/apps' || this.$route.path=='/login'){
            not_show_page =false
          }else{
            if(this.employeeId==22 && (this.$route.path.includes('/app/production/machine') || this.$route.path=='/app/production/dashboard')){
              not_show_page = false
            }else if(this.employeeId==24 && (this.$route.path.includes('/app/employee/worker') || this.$route.path=='/app/employee/dashboard')){
              not_show_page = false
            }else{
              not_show_page = true
            }
          }
        }
        if(not_show_page){
          this.showAlert("you don't have permission to access!",'red')
          this.goBack()
          // this.$router.push('/')
        }else if(is_maintenance_mode){
          this.$router.push('/')
        }
      }
    },
    getPlanAccess() {
      var headers = new Headers();
      headers.append("Authorization", "Bearer "+this.$root.token);
      fetch(this.api_url+'/production/supervisor_access/', {
          method : 'get',
          headers: headers,
      })
      .then((response) => {
          return response.json()
      })
      .then((jsonData) => {
        this.supervisor_access = jsonData
      })
    },
    getPurchaseTypes() {
      var headers = new Headers();
      headers.append("Authorization", "Token "+this.$root.token);
      fetch(this.api_url+'/qc/purchase_type/', {
          method : 'get',
          headers: headers,
      })
      .then((response) => {
          return response.json()
      })
      .then((jsonData) => {
        this.purchase_types = jsonData
      })
    },
    getWarehouses() {
      var headers = new Headers();
      headers.append("Authorization", "Token "+this.$root.token);
      fetch(this.api_url+'/qc/warehouses/', {
          method : 'get',
          headers: headers,
      })
      .then((response) => {
          return response.json()
      })
      .then((jsonData) => {
        this.warehouses = jsonData
      })
    },
    getGenerators() {
      var headers = new Headers();
      headers.append("Authorization", "Token "+this.$root.token);
      fetch(this.api_url+'/security/generators/', {
          method : 'get',
          headers: headers,
      })
      .then((response) => {
          return response.json()
      })
      .then((jsonData) => {
        this.generators = jsonData
      })
    },
    checkParam(param){
      if(param.limit_type=='<'){
        if(param.limit2 == 0){
          if(param.limit < param.limit1){

          }
        }else{
          if(param.limit > param.limit1 && param.limit < param.limit2){

          }
        }
      }else if(param.limit_type=='>'){
        if(param.limit2 == 0){
          if(param.limit > param.limit1){

          }
        }else{
          if(param.limit < param.limit1 && param.limit > param.limit2){

          }
        }
      }else if(param.limit_type=='%'){
        if(param.limit2 == 0){
          if(param.limit < param.limit1){

          }
        }else{
          if(param.limit >= param.limit1 && param.limit <= param.limit2){

          }
        }
      }
      return true
    },
    currentDate(date=new Date()){
      const today = new Date(date);
      const yyyy = today.getFullYear();
      let mm = today.getMonth() + 1; // Months start at 0!
      let dd = today.getDate();

      if (dd < 10) dd = '0' + dd;
      if (mm < 10) mm = '0' + mm;

      return yyyy + '-' + mm + '-' + dd;
    },
    currentMonth(date=null){
      var today = new Date();
      if(date){
        today = new Date(date)
      }
      const yyyy = today.getFullYear();
      let mm = today.getMonth() + 1;
      if (mm < 10) mm = '0' + mm;

      return yyyy + '-' + mm ;
    },
    timeAgo(input) {
      const date = (input instanceof Date) ? input : new Date(input);
      const formatter = new Intl.RelativeTimeFormat('en');
      const ranges = {
        // years: 3600 * 24 * 365,
        // months: 3600 * 24 * 30,
        // weeks: 3600 * 24 * 7,
        days: 3600 * 24,
        hours: 3600,
        minutes: 60,
        seconds: 1
      };
      const secondsElapsed = (date.getTime() - Date.now()) / 1000;
      var set_time = false
      for (let key in ranges) {
        if (ranges[key] < Math.abs(secondsElapsed)) {
          const delta = secondsElapsed / ranges[key];
          set_time = true
          return formatter.format(Math.round(delta), key);
        }
      }
      if(!set_time){
        return ''
      }
    },
    ageCalculation(input) {
      if(!input){
        return ''
      }
      var Bdate = (input instanceof Date) ? input : new Date(input);
      var age = ~~ ((Date.now() - Bdate) / (31557600000))
      return age;
    },
    onlyNumberKey(evt,code='') {
      var x = evt.target.value.replace(/\D/g, '').match(/(\d{0,14})/);
      if(code!=''){
        if(evt.target.value[0]==code){
          code = code
        }else{
          code = ''
        }
      }else{
        x = evt.target.value.replace(/\D/g, '').match(/(\d{0,10})/);
      }
      evt.target.value = code+x[1];
    },
    checkAlphaNumeric(value){
      var b = value.replace(/[^a-z0-9]/gi,'');
      return b
    },
    checkMult(num) {
      var mult = 's'
      if(num==1){
        mult = ''
      }
      return mult
    },
    goBack(pages=1){
      pages = 0-pages
      this.$router.go(pages) 
    },
    reloadPage(){
      location.reload()
    },
    pagination(items,page=10){
      var datas=[];
      var key=0;
      items.forEach(function(value,index){
        if((index%page)==0 || index==0){
          datas[key]=[]
        }
        datas[key].push(value)
        index = index+1
        if((index%page)==0){
          key++;
        }
      })
      key=datas.length
      if(datas.length<=1){key=0}
      return {total:key,datas:datas}
    },
    scroll_top: function(x=0,y=0){
      var i = 10;
      var int = setInterval(function() {
        window.scrollTo(0, i);
        i += 10;
        if (i >= y) clearInterval(int);
      }, 10);
      // window.scrollTo(x,y);
    },
    scrollToRefer(refer,block="end") {
      var el = this.$refs[refer];
      if (el) {
        el.scrollIntoView({ behavior: "smooth", block: block });
      }
    },
    dateFormate(date,is_time=false){
      if(!date){
        return ''
      }
      var mydate = new Date(date);
      var month = ["Jan", "Feb", "Mar", "Apr", "May", "June",
      "July", "Aug", "Sept", "Oct", "Nov", "Dec"][mydate.getMonth()];
      var time = '';
      if(is_time){
        var hour = mydate.getHours();
        var min = mydate.getMinutes();
        var sec = mydate.getSeconds();
        time = mydate.toLocaleTimeString([], {hour: '2-digit', minute:'2-digit'})
        if(hour==0&&min==0&&sec==0){
          time='';
        }
      }
      var str = mydate.getDate()+' '+month + ' ' +mydate.getFullYear()+' '+time;

      return str
    },
    timeFormate(time,is_time=true){
      if(!time){
        return ''
      }
      time = time.toString ().match (/^([01]\d|2[0-3])(:)([0-5]\d)(:[0-5]\d)?$/) || [time];
      if (time.length > 1) { // If time format correct
        time = time.slice (1);  // Remove full string match value
        time[5] = +time[0] < 12 ? 'AM' : 'PM'; // Set AM/PM
        time[0] = +time[0] % 12 || 12; // Adjust hours
        time[3] = ' ';
      }
      var str_time = time.join ('')
      return str_time;
    },
    slugify(string){
      string = string.toLowerCase()
      string = string.replace(' ','_')
      for (var i = 0; i < string.length; i++) {
        string = string.replace(' ','_') 
        string = string.replace('-','_')
        string = string.replace('/','_')
        string = string.replace('.','_')
      }
      return string
    },
    slugToWord(string){
      string = string.replace("_", " ");
      for (var i = 0; i < string.length; i++) {
        string = string.replace('_',' ') 
        string = string.replace('-',' ')
        string = string.replace('/',' ')
        string = string.replace('.',' ')
      }
      var splitStr = string.toLowerCase().split(' ');
      for (var i = 0; i < splitStr.length; i++) {
        splitStr[i] = splitStr[i].charAt(0).toUpperCase() + splitStr[i].substring(1);     
      }
      string = splitStr.join(' '); 

      return string;
    },
    dateString(date){
      var dateTime = new Date(date)
      return dateTime.getTime();
    },
    getDates(startDate, stopDate) {
      var dateArray = new Array();
      var currentDate = startDate;
      while (currentDate <= stopDate) {
          dateArray.push(new Date (currentDate));
          currentDate = this.addDays(currentDate,1);
      }
      return dateArray;
    },
    addDays(date1,days) {
      var date = new Date(date1);
      date.setDate(date.getDate() + days);
      return date;
    },
    bgToTextColor(bgColor) {
      if(!bgColor){
        return ''
      }
      var lightColor = '#ffffff';
      var darkColor = '#000000'
      var color = (bgColor.charAt(0) === '#') ? bgColor.substring(1, 7) : bgColor;
      var r = parseInt(color.substring(0, 2), 16); // hexToR
      var g = parseInt(color.substring(2, 4), 16); // hexToG
      var b = parseInt(color.substring(4, 6), 16); // hexToB
      var uicolors = [r / 255, g / 255, b / 255];
      var c = uicolors.map((col) => {
        if (col <= 0.03928) {
          return col / 12.92;
        }
        return Math.pow((col + 0.055) / 1.055, 2.4);
      });
      var L = (0.2126 * c[0]) + (0.7152 * c[1]) + (0.0722 * c[2]);
      return (L > 0.279) ? darkColor : lightColor;
    },
    showAlert(message='',type2="green",time=2000){
      if(type2=='error'){
        this.$swal({
          type: "error",
          title: "Oops...",
          text: message,
          footer: "<a href>Why do I have this issue?</a>"
        });
      }
      else if(type2=='confirm') {
        this.$swal({
          title: "Are you sure?",
          text: message,
          type: "warning",
          showCancelButton: true,
          confirmButtonColor: "#3085d6",
          cancelButtonColor: "#d33",
          confirmButtonText: "Yes, delete it!"
        }).then(result => {
          if (result.value) {
            this.$swal("Deleted!", "Your file has been deleted.", "success");
          }
        });
      }
      else {
        this.setAlert(message, type2, time)
        // this.$swal({
        //   position: "top-end",
        //   title: message,
        //   showConfirmButton: false,
        //   timer: 15000
        // });
      }
    },
    setAlert(message='',type='green',timeout=2000,m=1){
      message = this.slugToWord(message)
      if(this.$root.alert_message.show==1){
        m=2;
        if(this.$root.alert_message2.show==1){
          this.$root.alert_message.show=0;
          m=1;
        }
      }
      if(m==1){
        this.$root.alert_message={show:1,message:message,type:type}
      }else if(m==2){
        this.$root.alert_message2={show:1,message:message,type:type}
      }
      setTimeout(this.closeAlert,timeout,m)
    },
    closeAlert(m){
      if(m==1){
        this.$root.alert_message.show=0
      }else if(m==2){
        this.$root.alert_message2.show=0
      }
    },
  }
});

